import React from "react";

const conteudos = [
    {
      conteudo: 'High Order Functions',
      bloco: 8,
      status: 'Aprendido'
    },
    {
      conteudo: 'Composicao de Componentes',
      bloco: 11,
      status: 'Aprendendo',
    },
    {
      conteudo: 'Composicao de Estados',
      bloco: 12,
      status: 'Aprenderei'
    },
    {
      conteudo: 'Redux',
      bloco: 16,
      status: 'Aprenderei'
    },
  ];

  const func = (arr) => {
      return (
          <div>
              {
                conteudos.map(item => 
                    <li></li>`O conteúdo é : ${item.conteudo},
                    Status: ${item.status},
                    Bloco: ${item.bloco}`
                    )
              }
          </div>
      )
  }

class Content extends React.Component {
    render(){
        return (
            func(conteudos)
        )
    }
}

export default Content
